import { useState } from "react";

const Tasks = props => {
  const [tasks, setTasks] = useState([
    {
      id: 1,
      text: 'Doctor Appointment',
      day: 'Feb 5th at 2:30 pm',
      reminder: true
    },
    {
      id: 2,
      text: 'Doctor Appointment',
      day: 'Feb 5th at 2:30 pm',
      reminder: true
    }
  ])

  return (
    <>
    {
      tasks.map((task) => (
        <h3 key={task.id}>{task.text}</h3>
      ))}
      
    </>
  )
}

Tasks.propTypes = {

}

export default Tasks
